import React from 'react';
import AyungonHeader from '../assets/AyungonHeader.png';
const Navbar = () => {
	return (
		<div>
			<div className="flex bg-green-600 w-screen justify-between items-center">
				<div>
					<img
						className="w-80 "
						src={AyungonHeader}
						alt=""
					/>
				</div>

				<div className="p-3">
					<h2>asdasdasdsad</h2>
				</div>
			</div>

			{/* Navigation bar */}
			<div className="">
				<div className="flex flex-row justify-center items-center gap-20 font-Cinzel font-medium ">
					<div>Home</div>
					<div>Full Disclosure</div>
					<div>Bids and Awards</div>
					<div>About The Town</div>
					<div>Offices</div>
					<div>Officials</div>
				</div>
			</div>
		</div>
	);
};

export default Navbar;
